 #!/bin/bash

 # Fixed installation script with proper error handling and paths
 set -e  # Exit on any error

 # Function to print installation steps
 print_step() {
     echo "ðŸ”§ $1"
 }

 # Function to print success messages
 print_success() {
     echo "âœ… $1"
 }

 # Function to print error messages
 print_error() {
     echo "âŒ $1" >&2
 }

 # Installation directories
 INSTALL_DIR="/opt/enx-kebord"
 DESKTOP_DIR="$HOME/.local/share/applications"
 AUTOSTART_DIR="$HOME/.config/autostart"
 BIN_DIR="/usr/local/bin"

 print_step "Starting ENX-Kebord installation..."

 # Check if running as root for system installation
 if [[ $EUID -ne 0 ]]; then
     print_error "This script must be run as root (use sudo)"
     exit 1
 fi

 # Create directories
 print_step "Creating installation directories..."
 mkdir -p "$INSTALL_DIR"
 mkdir -p "$DESKTOP_DIR"
 mkdir -p "$AUTOSTART_DIR"

 # Copy all files from current directory to installation directory
 print_step "Copying application files..."
 cp -r ./* "$INSTALL_DIR/" 2>/dev/null || {
     print_error "Failed to copy files to $INSTALL_DIR"
     exit 1
 }

 # Set proper permissions
 chown -R root:root "$INSTALL_DIR"
 chmod -R 755 "$INSTALL_DIR"
 chmod +x "$INSTALL_DIR"/*.sh 2>/dev/null || true

 create_icon() {
     print_step "Creating application icon..."

     # Create a simple keyboard icon using ImageMagick or fallback to text-based icon
     if command -v convert >/dev/null 2>&1; then
         # Create with ImageMagick if available
         convert -size 32x32 xc:transparent \
             -fill '#2563eb' -draw 'roundrectangle 2,8 30,24 3,3' \
             -fill white -pointsize 8 -gravity center -annotate +0+0 'ENX' \
             "$INSTALL_DIR/enx-kebord-icon.png" 2>/dev/null || create_fallback_icon
     else
         create_fallback_icon
     fi

     print_success "Application icon created!"
 }

